import React from 'react';

export default function About() {
  return (
    <section className="my-8">
      <h2 className="text-2xl font-semibold mb-3">About Me</h2>
      <div className="card">
        <p>
          I am a final-year B.Tech student in Computer Science and Engineering at Ramachandra College of Engineering, Eluru (CGPA 8.4). I enjoy web development, AI/ML, and solving real-world problems with clean, maintainable code.
        </p>
      </div>
    </section>
  );
}
